import React, { Component } from 'react'
import { Button } from 'react-bootstrap'

export class SignupClass extends Component {

    state={
        count:0,
        phone:'',
        password:'',
        consfirmPassword:'',
    }
    onChangeHandler=()=>{
        this.setState({
            count:this.state.value +1 ,
             
        })
    }
    render() {
        return (
            <div>
             <h1>{this.state.count}</h1>

             <Button className="btn btn-success" onClick={this.onChangeHandler}>Click</Button>
              
            </div>
        )
    }
}

export default SignupClass
